import React from 'react';
import styled from 'styled-components';

const ImageWrapper = styled.section`
    width: 100%;
    height: 100vh;
    position: relative;
    overflow: hidden;

    &::after {
        content: '';
        position: absolute;
    }
    .person{
        position: absolute;
        width: 650px;
        bottom: -100px;
        left: -70px;
        z-index: 20;
    }

    .mountain1{
        position: absolute;
        bottom: -100px;
        width: 1500px;
        right: 0;
        z-index: 19;
    }
    .mountain2{
        position: absolute;
        width: 1100px;
        bottom: -100px;
        left: 0;
        z-index: 18;
    }
    .mountain3{
        position: absolute;
        width: 900px;
        bottom: 150px;
        right: 0;
        z-index: 17;
    }
`;

export default function HomeBackground() {
    return (
        <ImageWrapper>

            <h1>Tell everyone about the twists and turns in your journey</h1>


            <img src="img/person.png" alt="" className='person'></img>
            <img src="img/mountain1.png" alt="" className='mountain1'></img>
            <img src="img/moutain2.png" alt="" className='mountain2'></img>
            <img src="img/mountain3.png" alt="" className='mountain3'></img>
            <img src="img/sky.png" alt="" className='landingPage-photo'></img>

        </ImageWrapper>
    )
}
